Airwolf3D v5.5 was my first 3D printer and it didn´t have fans on the extruder head. So, I made this part in order to solve this little problem.<br />
I include two mounts: one for old hot end and another for new one (quick change hot end). The difference is in the height  
P.S. Sorry for description... I should be &quot;Dual Fan Holder&quot;
